import React from 'react'
import '../../src/editor.css';

function Editor(menuData) {
  return (
    <div className="editor">
      <div className="profile">
        <ul>
          <p className="list">Dark mode</p>
          <li className="list">Profile</li>
          <li className="list">What's new</li>
          <li className="list">Help</li>
          <li className="list">Send feedback</li>
          <li className="list">Hints and shortcuts</li>
          <li className="list">Log out</li>
        </ul>
      </div>
     <h1>{menuData.menuData.title}</h1>
     {console.log(menuData)}
     {console.log(menuData.menuData.content)}
     <div className="content">

       {menuData.menuData.type === 'img' || menuData.menuData.type === 'video'?
       
       <img src={require('../../images/' + menuData.menuData.content).default} alt = "noimage" height={200} width={200}></img>
       :<p>{menuData.menuData.content}</p>
       }

     </div>
    </div>
  );
}

export default Editor;
